 {
  "Index": 187,
  "Tagged Entry": "<b>Age at Accident: </b><span data-tagname=\"age_group: age_25_34\" class=\"tag category-3\">age_25_34</span><br/><b>Severity: </b><span data-tagname=\"gender: male\" class=\"tag category-6\">male</span><br/><b>Gender: </b><span data-tagname=\"severity: ndi\" class=\"tag category-10\">ndi</span><br/><hr/>IP was moving a piece of stone and strained his <span data-tagname=\"body_part: lower_back\" class=\"tag category-4\">lower back</span> when he lifted the stone.\n"
 },
 {
  "Index": 188,
  "Tagged Entry": "<b>Age at Accident: </b><span data-tagname=\"age_group: age_35_44\" class=\"tag category-3\">age_35_44</span><br/><b>Severity: </b><span data-tagname=\"gender: male\" class=\"tag category-6\">male</span><br/><b>Gender: </b><span data-tagname=\"severity: ndi\" class=\"tag category-10\">ndi</span><br/><hr/>Piece of rock fell on <span data-tagname=\"body_part: leg\" class=\"tag category-4\">leg</span> while splitting rock. Was putting a rock on a pallet & the rock fell. Noi and how accident happened per call to alecia clifford 4/29/05 MB\n"
 },
 {
  "Index": 189,
  "Tagged Entry": "<b>Age at Accident: </b><span data-tagname=\"age_group: age_35_44\" class=\"tag category-3\">age_35_44</span><br/><b>Severity: </b><span data-tagname=\"gender: male\" class=\"tag category-6\">male</span><br/><b>Gender: </b><span data-tagname=\"severity: ndi\" class=\"tag category-10\">ndi</span><br/><hr/>Ip was lifting blocks of junk stone from his work station to clean the area. While lifting a stone weighing approx 100lbs he sustained a sharp pain in his right abdomen area. Physician diagnosis: abdomenal <span data-tagname=\"injury: strain\" class=\"tag category-7\">strain</span>. Released to ret to light duty status until further notice\n"
 },
 {
  "Index": 190,
  "Tagged Entry": "<b>Age at Accident: </b><span data-tagname=\"age_group: age_65_100\" class=\"tag category-3\">age_65_100</span><br/><b>Severity: </b><span data-tagname=\"gender: male\" class=\"tag category-6\">male</span><br/><b>Gender: </b><span data-tagname=\"severity: ndi\" class=\"tag category-10\">ndi</span><br/><hr/><span data-tagname=\"person: injured_person\" class=\"tag category-9\">injured person</span> was splitting a block of sandstone using a 12 lb. hammer and stone chisel. He was using his <span data-tagname=\"body_part: left_foot\" class=\"tag category-4\">left foot</span> to hold his chisel in position on a bench in the block of stone so he could strike the chisel and split the stone. He inadvertantly missed the chisel and struck his <span data-tagname=\"body_part: left_foot\" class=\"tag category-4\">left foot</span>.\n"
 },
 {
  "Index": 191,
  "Tagged Entry": "<b>Age at Accident: </b><span data-tagname=\"age_group: age_25_34\" class=\"tag category-3\">age_25_34</span><br/><b>Severity: </b><span data-tagname=\"gender: male\" class=\"tag category-6\">male</span><br/><b>Gender: </b><span data-tagname=\"severity: ndi\" class=\"tag category-10\">ndi</span><br/><hr/>Splitting stone & felt pain in <span data-tagname=\"body_part: back\" class=\"tag category-4\">back</span>. NOTE: ip was released to come <span data-tagname=\"body_part: back\" class=\"tag category-4\">back</span> on 8-12-02. He did, but when he went to his follow-up visit on 8-14-02, he was put off work for a longer period.\n"
 },
 {
  "Index": 192,
  "Tagged Entry": "<b>Age at Accident: </b><span data-tagname=\"age_group: age_65_100\" class=\"tag category-3\">age_65_100</span><br/><b>Severity: </b><span data-tagname=\"gender: male\" class=\"tag category-6\">male</span><br/><b>Gender: </b><span data-tagname=\"severity: ndi\" class=\"tag category-10\">ndi</span><br/><hr/>While performing maintenance on the heater thermostat of a 988F wheel loader, the <span data-tagname=\"body_part: right_hand\" class=\"tag category-4\">right hand</span> middle finger came in contact with squirrel fan.\n"
 },
 {
  "Index": 193,
  "Tagged Entry": "<b>Age at Accident: </b><span data-tagname=\"age_group: age_35_44\" class=\"tag category-3\">age_35_44</span><br/><b>Severity: </b><span data-tagname=\"gender: male\" class=\"tag category-6\">male</span><br/><b>Gender: </b><span data-tagname=\"severity: ndi\" class=\"tag category-10\">ndi</span><br/><hr/>Busted <span data-tagname=\"body_part: chest\" class=\"tag category-4\">chest</span>, cracked cartilege, breathing problems\n"
 },
 {
  "Index": 194,
  "Tagged Entry": "<b>Age at Accident: </b><span data-tagname=\"age_group: age_35_44\" class=\"tag category-3\">age_35_44</span><br/><b>Severity: </b><span data-tagname=\"gender: male\" class=\"tag category-6\">male</span><br/><b>Gender: </b><span data-tagname=\"severity: ndi\" class=\"tag category-10\">ndi</span><br/><hr/><span data-tagname=\"person: operator\" class=\"tag category-9\">Operator</span> was in a hurry to get off of the loader and lost his balance. He then tripped over a rock landing on his hip and rt. <span data-tagname=\"body_part: leg\" class=\"tag category-4\">LEG</span>. His rt. <span data-tagname=\"body_part: wrist\" class=\"tag category-4\">Wrist</span> hit the ground and rt. <span data-tagname=\"body_part: arm\" class=\"tag category-4\">Arm</span> hit loader tire. He sustained a sprained <span data-tagname=\"body_part: wrist\" class=\"tag category-4\">wrist</span> & <span data-tagname=\"body_part: shoulder\" class=\"tag category-4\">SHOULDER</span>.\n"
 },
 {
  "Index": 195,
  "Tagged Entry": "<b>Age at Accident: </b><span data-tagname=\"age_group: age_55_64\" class=\"tag category-3\">age_55_64</span><br/><b>Severity: </b><span data-tagname=\"gender: male\" class=\"tag category-6\">male</span><br/><b>Gender: </b><span data-tagname=\"severity: ndi\" class=\"tag category-10\">ndi</span><br/><hr/>While drilling at the face of 690, a rock rolled out of the face, Miner jumped <span data-tagname=\"body_part: back\" class=\"tag category-4\">back</span> to avoid rock and felt his knIP pop.  Miner took ibuprofen and finished shift.  When miner got home knIP started to swell.\n"
 },
 {
  "Index": 196,
  "Tagged Entry": "Removing bucket teeth from 988 LOADER 023-809 for replacement. Ip was using a sledge hammer to remove one of the teeth. Upon striking one of the teeth a piece of metal came off and lodged into his skin just underneath his cheek bone. Full release.\n"
 },
 {
  "Index": 197,
  "Tagged Entry": "<b>Age at Accident: </b><span data-tagname=\"age_group: age_65_100\" class=\"tag category-3\">age_65_100</span><br/><b>Severity: </b><span data-tagname=\"gender: male\" class=\"tag category-6\">male</span><br/><b>Gender: </b><span data-tagname=\"severity: ndi\" class=\"tag category-10\">ndi</span><br/><hr/>Two maintenance injured persons were raising liners on a discharge <span data-tagname=\"equipment: chute\" class=\"tag category-5\">chute</span> which was on ground level.  One <span data-tagname=\"person: injured_person\" class=\"tag category-9\">injured person</span> was positioned inside with a four pound hammer while the other <span data-tagname=\"person: injured_person\" class=\"tag category-9\">injured person</span> was outside with the impact drill.  The <span data-tagname=\"person: injured_person\" class=\"tag category-9\">injured person</span> inside began to hammer on the liner, the <span data-tagname=\"person: injured_person\" class=\"tag category-9\">injured person</span> outside noticed that it was stuck and positioned his hands to push when his left index finger was struck.\n"
 },
 {
  "Index": 198,
  "Tagged Entry": "<b>Age at Accident: </b><span data-tagname=\"age_group: age_25_34\" class=\"tag category-3\">age_25_34</span><br/><b>Severity: </b><span data-tagname=\"gender: male\" class=\"tag category-6\">male</span><br/><b>Gender: </b><span data-tagname=\"severity: fatal\" class=\"tag category-10\">fatal</span><br/><hr/>IP was on fire watch when debris from a welder grinding flew into EE's <span data-tagname=\"body_part: right_eye\" class=\"tag category-4\">right eye</span>\n"
 },
 {
  "Index": 199,
  "Tagged Entry": "<b>Age at Accident: </b><span data-tagname=\"age_group: age_35_44\" class=\"tag category-3\">age_35_44</span><br/><b>Severity: </b><span data-tagname=\"gender: male\" class=\"tag category-6\">male</span><br/><b>Gender: </b><span data-tagname=\"severity: fatal\" class=\"tag category-10\">fatal</span><br/><hr/>Ip was <span data-tagname=\"activity: walking\" class=\"tag category-2\">walking</span> from primary <span data-tagname=\"equipment: crusher\" class=\"tag category-5\">crusher</span> to grease house. The weather was rain and sleeting. Ip slipped or tripped and fell.\n"
 },
 {
  "Index": 200,
  "Tagged Entry": "<b>Age at Accident: </b><span data-tagname=\"age_group: age_25_34\" class=\"tag category-3\">age_25_34</span><br/><b>Severity: </b><span data-tagname=\"gender: male\" class=\"tag category-6\">male</span><br/><b>Gender: </b><span data-tagname=\"severity: fatal\" class=\"tag category-10\">fatal</span><br/><hr/>Called out due to a top punch plate having detached from its mounting...falling into exit <span data-tagname=\"equipment: chute\" class=\"tag category-5\">chute</span> of the large screen...raising was with come-a-long pulling along the center of a length of chain attached to upper corner(s) of the punch plate...plate got stuck...was using pry bar to frIP plate...chain hook released from chain striking center forehead...(8) stitches...no lost workdays."
 }
